function RSwrapper(inputData) {
    const outputData = Analytics.calculateRS(inputData, imageSize); 
    const detectorName = "RS"
    const result = {
        Name: detectorName,
        Result: outputData
    };
    return result;
}

async function ResNetWrapper(inputData) {
    // 0.35 cutoff
    const inputTensor = new onnx.Tensor(inputData, 'uint8', [1, 1, imageSize, imageSize]);
    const outputMap = await session.run([inputTensor]);
    // const outputData = outputMap.values().next().value.data[1].toFixed(3) > 0.5055;
    const outputData = outputMap.values().next().value.data[1].toFixed(3);
    const detectorName = "ResNet"
    const result = {
        Name: detectorName,
        Result: outputData
    };
    return result;
}

function preprocess(data, width, height) {
    let dataFromImage = ndarray(new Uint8Array(data), [width, height, 1]);
    // const dataProcessed = ndarray(new Float32Array(width * height * 3), [1, 3, height, width]);
    let dataProcessed = ndarray(new Uint8Array(width * height * 1), [1, 1, height, width]);
    
    //is this needed?
    // dataFromImage = ops.divseq(dataFromImage, 255.0);
  
    // Realign imageData from [224*224*4] to the correct dimension [1*3*224*224].
    // ndarray.ops.assign(dataProcessed.pick(0, 0, null, null), dataFromImage.pick(null, null, 2));
    // ndarray.ops.assign(dataProcessed.pick(0, 1, null, null), dataFromImage.pick(null, null, 1));
    // ndarray.ops.assign(dataProcessed.pick(0, 2, null, null), dataFromImage.pick(null, null, 0));
    ops.assign(dataProcessed.pick(0, 0, null, null), dataFromImage.pick(null, null, 0));
    return dataProcessed.data; 
}
